Ukusetyenziswa
Lo matshini unokusetyenziswa kwi-hardware, izixhobo, iibhetri, izinto zokubhala, iimfuno zemihla ngemihla, izithambiso, iinxalenye zemoto kunye namashishini ahlukeneyo.
Uphawu
1. i-mechanical drive, i-servo motor traction, isakhiwo esifanelekileyo, ukusebenza okulula;
2. igobolondo yensimbi engenasici, inkangeleko entle, ukucocwa okufanelekileyo, ukuphucula ibakala lemveliso;
3. Inkqubo yokulawula i-PLC, ukulawulwa kwesantya sokuguqulwa kwamaza, ukunciphisa ingxolo, ukuphucula ukuzinza komsebenzi womatshini;
4. ulawulo photoelectric, ubhaqo oluzenzekelayo, ukubala imveliso ngokuzenzekelayo, isikhumbuzi fault oluzenzekelayo.
Ipharamitha
Umsebenzi
Iphepha le-1.PVC 2. ukufudumeza kwe-PVC 3. ikhadi le-blister ukwenza 4.ingqokelela ye-scrap 5.i-blister die cutting 6. imveliso yemveliso

Abasebenzi be-HONGSBELT®
◆ Sisoloko sizama ukuphucula ukusebenza kakuhle, kwaye senze ixabiso elingakumbi kubathengi;
◆ Sisebenza kunye kwaye siyangenelwa kwimpumelelo yomnye nomnye;
◆ Sibaphatha ngentlonipho, ukunyaniseka nobulungisa abathengi bethu, ababoneleli kunye nabo sikhuphisana nabo, kanye njengoko silindele ukukufumana kubo;
◆ Siyazingca ngomsebenzi wethu yaye singena kuwo ngehlombe elikhulu;
◆ Ukuphulaphula iimbono zabanye, siqhubeka sikhula ngokufunxa imvelaphi ebalaseleyo kuye wonke umntu osingqongileyo;
◆ Thatha uxanduva lwakho, sikholelwa ukuba ukusebenza ngokufanelekileyo kunokuphunyezwa kuphela ngabasebenzi abanokuziphatha okungqongqo;
◆ Ukufumana ulonwabo kwimisebenzi, inkcubeko yethu yeshishini idala imeko elungileyo, yokuphumla eyenza abasebenzi bethu bayile kwaye basebenze;
